import React from 'react';
import '../../normalize.scss';
import '../../styles/base.scss';
import CodConfirmacao from '../../components/Cadastro/InicioDoCadastro/CodConfirmacao';
import View from "../view/view"

const CodConfirm = () => (
  <React.Fragment>
      <View register={true}>
          <CodConfirmacao/>
      </View>
    </React.Fragment>
); 

export default CodConfirm;
